from tester import Tester

class Solution:
    def findMaxLength(self, nums):
        if len(nums) < 2:
            return 0
        
        answer = 0
            
        arr = [-2] * (len(nums) * 2 + 1)
        arr[len(nums)] = -1

        cnt = 0
        for i in range(len(nums)):
        	v = int((nums[i]-0.5)*2)
        	cnt += v
        	
        	idx = cnt + len(nums)
        	if arr[idx] > -2:
        		answer = max(answer, i-arr[idx])
        	else:
        		arr[idx] = i
        	# print("{}:{}:{} :: {} : {} : {}".format(i, cnt, idx, arr, arr[idx], i-arr[idx]))
        
        # print(arr)
        return answer

		
